import "./navbar.css"
import React ,{useState,useEffect}from 'react';
import { throttle } from "lodash";


export default function Navbar() {
  const [value, setValue] = useState(0)
  useEffect(throttle(() => console.log(value), 300), [value])

  return (
    <div class="form-group has-success has-feedback">
      <label class="col-sm-2 control-label" for="inputSuccess">Search</label>
      <div class="col-sm-10">
        <input type="text" class="form-control" id="inputSuccess"  onClick={(e) => setValue(e.target.value)}/>
        <span class="glyphicon glyphicon-ok form-control-feedback"></span>
      </div>
    </div>
  )

}
